package com.message.domain.output;/** * @author: XiGuoQing * @description: * @date: Created in 上午 11:58 2018/10/26 0026 * @modified by: */public class EmployeesOutput {  private Integer employeeId;  private String employeeName;  private Integer organizationId;  private String employeeNo;  private String tel;  public Integer getEmployeeId() {    return employeeId;  }  public void setEmployeeId(Integer employeeId) {    this.employeeId = employeeId;  }  public String getEmployeeName() {    return employeeName;  }  public void setEmployeeName(String employeeName) {    this.employeeName = employeeName;  }  public Integer getOrganizationId() {    return organizationId;  }  public void setOrganizationId(Integer organizationId) {    this.organizationId = organizationId;  }  public String getEmployeeNo() {    return employeeNo;  }  public void setEmployeeNo(String employeeNo) {    this.employeeNo = employeeNo;  }  public String getTel() {    return tel;  }  public void setTel(String tel) {    this.tel = tel;  }}